import React from 'react';
import { problemGroups } from './ProblemData';

const ProblemGroupSelection = ({ onSelectGroup }) => {
    return (
        <div>
            <h1>問題グループを選択してください</h1>
            {problemGroups.map((group, index) => (
                <button key={index} onClick={() => onSelectGroup(group)}>
                    {group.name}
                </button>
            ))}
        </div>
    );
};

export default ProblemGroupSelection;
